create table reservations
(
    id                 int not null
        primary key,
    screenings_id      int not null,
    clients_id         int not null,
    payment_methods_id int not null,
    constraint reservations_clients
        foreign key (clients_id) references clients (id),
    constraint reservations_payment_methods
        foreign key (payment_methods_id) references payment_methods (id),
    constraint reservations_screenings
        foreign key (screenings_id) references screenings (id)
);

